protected void rot(ref double x,ref double y,double angle) {
    double f = Math.PI / 180.0;
  double re = Math.Cos(angle* f); 
            double im = Math.Sin(angle * f);
            double a = re * x - im * y;
            y = re * y + im * x;
            x = a;

}

        public override long InSet(double ar, double ai, double aj, double br, double bi, double bj, double bk, long zkl, bool invers) {


            double aar, aai, ai_alt, aj_alt, aaj, aak, cj, ck, ari, arj, ark, aik, aij, ajk, ak_alt;
            double c, d;
            long tw;
            int n;

double ak=0;
            aar = ar * ar; aai = ai * ai; aaj = aj * aj; aak=ak*ak; tw = 0L;
            d = aar + aai + aaj;
            for (n = 1; n < zkl; n++) {
//ai=ai-bi;
//aj=aj-bj;
//ar=ar-br;
  rot(ref ai,ref ar,28);
 rot(ref aj,ref ar,28);
 rot(ref ai,ref aj,28);
//ai=ai+bi;
//aj=aj+bj;
//ar=ar+br;

   ai = 2.0 * ar * ai + bi;
                aj = 2.0 * ar * aj + bj;
                ak = 2.0 * ar * ak + bk;
                ar = aar - aai - aaj - aak + br;
                aar = ar * ar; aai = ai * ai; aaj = aj * aj;aak=ak*ak;
                d = aar + aai + aaj+aak;
                if ((d) > gr) { tw = n; break; }
            }
            return (tw);

        }
